    false,nt"url": null,nt"notes": " The Address Ranges Relationship File (ADDR.dbf)
    contains the attributes of each address range.  Each address range applies to a
    single edge and has an               unique address range identifier (ARID) value.
     The edge to which an address range applies can be determined by linking the address
    range to the All Linesn               Shapefile (EDGES.shp) using the permanent
    topological edge identifier (TLID) attribute.  Multiple address ranges can apply
    to the same edge since an edgen               can have multiple address ranges.
     Note that the most inclusive address range associated with each side of a street
    edge already appears in the All Linesn               Shapefile (EDGES.shp).  The
    TIGER/Line Files contain potential address ranges, not individual addresses.  The
    term "address range" refers to then               collection of all possible structure
    numbers from the first structure number to the last structure number and all numbers
    of a specified parity inn               between along an edge side relative to the
    direction in which the edge is coded.  The address ranges in the TIGER/Line Files
    are potential ranges thatn               include the full range of possible structure
    numbers even though the actual structures may not exist.n               n               The
    TIGER/Line shapefiles and related database files (.dbf) are an extract of selected
    geographic and cartographic information from then               U.S. Census Bureau's
    Master Address File / Topologically Integrated Geographic Encoding and Referencing
    (MAF/TIGER) Database (MTDB).  The MTDB representsn               a seamless national
    file with no overlaps or gaps between parts, however, each TIGER/Line shapefile
    is designed to stand alone as an independent data set,n               or they can
    be combined to cover the entire nation.",nt"license_title": null,nt"extras":
